script: |
  super -f text -I q33.spq | sort > q33.out

inputs:
  - name: q33.spq
    data: |
      SELECT ALL - 10 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q33.out
    data: |
      -10
      -10
      -10
      -10
      -10
      -10
      -10
      -10
      -10
